 INSERT INTO srdb.assessment VALUES('WGNSDS-HADIS-1991-2006-MINTO', 'WGNSDS', 'HADIS', 'MINTO', '2008-04-14', '2009-03-17 21:09:08', '1991-2006', 'http://www.ices.dk/products/CMdocs/CM-2007/CM2007.pdf', 'NULL', 'Note: F is not estimated for this stock.', 'ICES-WGNSDS-2007.pdf', 1, 1, 'SURBA', 'The absolute level of F in this stock at present is poorly known. No limit reference points have been set for this stock due to the short time-series of assessment data. ICES has adopted a precautionary Fpa of 0.5 as this is the value for the neighbouring stock in VIa. The final assessment presented is based on survey data alone and therefore no F series is available.', '../spreadsheets/MINTO-HADIS-2007-editedDR.xls') ; 
